import React from 'react';

function About() {
  return (
    <div className="page-container">
      <div style={{maxWidth: '1000px', margin: '0 auto'}}>
        
        {/* --- HEADER --- */}
        <div className="features-header animate-up">
          <h2 style={{fontSize: '3rem'}}>Behind The Code</h2>
          <p>
            Bridging the gap between artificial intelligence and wildlife conservation.
          </p>
        </div>

        {/* --- SPLIT LAYOUT: STORY & PROFILE --- */}
        <div style={{
          display: 'grid', 
          gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
          gap: '3rem',
          marginTop: '3rem'
        }}>
          
          {/* LEFT: THE STORY */}
          <div className="animate-up delay-1">
            <div style={{
              background: 'rgba(255,255,255,0.03)', 
              padding: '2.5rem', 
              borderRadius: '20px', 
              border: '1px solid rgba(255,255,255,0.08)',
              height: '100%'
            }}>
              <h3 style={{color: '#10b981', fontSize: '1.8rem', marginBottom: '1.5rem'}}>
                Project Vision
              </h3>
              <p style={{color: '#a1a1aa', lineHeight: '1.8', marginBottom: '1.5rem'}}>
                WildGuard AI was born out of a simple question: <strong>How can we use modern technology to protect those who cannot protect themselves?</strong>
              </p>
              <p style={{color: '#a1a1aa', lineHeight: '1.8'}}>
                As part of my MCA curriculum, I wanted to build something that wasn't just code, but a solution to a real-world problem. By leveraging the speed of <strong>YOLOv8</strong> and the interactivity of <strong>React</strong>, this system proves that surveillance can be automated, accurate, and humane.
              </p>
            </div>
          </div>

          {/* RIGHT: DEVELOPER PROFILE */}
          <div className="animate-up delay-2">
            <div className="feature-card" style={{height: '100%', alignItems: 'center', textAlign: 'center'}}>
              {/* Profile Image Placeholder */}
              <div style={{
                width: '120px', height: '120px', 
                borderRadius: '50%', 
                background: 'linear-gradient(135deg, #10b981 0%, #059669 100%)',
                margin: '0 auto 1.5rem',
                display: 'flex', alignItems: 'center', justifyContent: 'center',
                fontSize: '3rem', border: '4px solid rgba(0,0,0,0.3)'
              }}>
                üë®‚Äçüíª
              </div>
              
              <h3 style={{fontSize: '1.8rem', marginBottom: '5px'}}>Sohebkhan Pathan</h3>
              <p style={{color: '#10b981', fontWeight: 'bold', marginBottom: '1.5rem'}}>
                Full Stack Developer | MCA Student
              </p>
              
              <p style={{color: '#888', marginBottom: '2rem'}}>
                Passionate about building scalable web applications and exploring the frontiers of Computer Vision.
              </p>

              <div style={{display: 'flex', gap: '1rem', justifyContent: 'center'}}>
                <SocialBtn label="GitHub" />
                <SocialBtn label="LinkedIn" />
                <SocialBtn label="Portfolio" />
              </div>
            </div>
          </div>

        </div>

        {/* --- BOTTOM: TECH BADGES --- */}
        <div className="animate-up delay-3" style={{marginTop: '5rem', textAlign: 'center'}}>
          <h4 style={{color: '#555', textTransform: 'uppercase', letterSpacing: '2px', marginBottom: '2rem'}}>
            Developed With
          </h4>
          <div className="tech-icons">
             <Badge text="React.js" />
             <Badge text="Node.js" />
             <Badge text="Python" />
             <Badge text="OpenCV" />
             <Badge text="Machine Learning" />
          </div>
        </div>

      </div>
    </div>
  );
}

// Helper Components
function SocialBtn({ label }) {
  return (
    <button style={{
      background: 'rgba(255,255,255,0.1)', 
      border: 'none', 
      color: 'white', 
      padding: '8px 16px', 
      borderRadius: '20px', 
      cursor: 'pointer',
      fontSize: '0.9rem',
      transition: '0.3s'
    }}
    onMouseOver={(e) => e.target.style.background = '#10b981'}
    onMouseOut={(e) => e.target.style.background = 'rgba(255,255,255,0.1)'}
    >
      {label}
    </button>
  );
}

function Badge({ text }) {
  return (
    <span style={{
      padding: '10px 20px', 
      border: '1px solid #333', 
      borderRadius: '8px', 
      color: '#888',
      fontSize: '0.9rem'
    }}>
      {text}
    </span>
  );
}

export default About;
